import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App, {AppProps} from './App';
import {v1} from "uuid";

export type PostsType = {
   id: string,
    name: string,
    messagePost: string,
    count: number
}

export interface AppProps {
    posts: PostsType[];
    usersData: UserDataType[];
    messagesData: MessageDataType[];
    removePost: (id: string) => void;
}

export type UserDataType = {
    id: string, name: string
}

export type MessageDataType = {
    id: number, message: string
}

export const posts: Array<PostsType> = [
    {id: v1(), name: 'Oldos', messagePost: 'Hi! Like my post!', count: 1},
    {id: v1(), name: 'Ariel', messagePost: 'Like my post!', count: 15},
    {id: v1(), name: 'Inga', messagePost: 'Hi! Like my!', count: 22},
    {id: v1(), name: 'Mara', messagePost: 'Like!', count: 2},
]

export const usersData: UserDataType[] = [
    {id: ':DIALOG1', name: 'Vatsok'},
    {id: ':DIALOG2', name: 'Goshan'},
    {id: ':DIALOG3', name: 'Ivan'},
    {id: ':DIALOG4', name: 'Dre Dr'},
]


const messagesData: MessageDataType[] = [
    {id: 1, message: 'Ho'},
    // {id: ':MESSAGE1', message: 'HIIIIII'},
    {id: 2, message: 'Hi'},
    {id: 3, message: 'Hoo'},
    {id: 4, message: 'Hm'},
]

const removePostHandler: AppProps = (id: string) => {
    props.removePost(id)
}


ReactDOM.render(
    <App posts={posts}
         usersData={usersData}
         messagesData={messagesData}
         removePost={removePostHandler}

    />,
    document.getElementById('root')
);
